import React from "react";
import {Row, Col, Container} from "reactstrap";

const Footer = () => {
	return (
		<React.Fragment>
			<footer className="footer">
				<Container fluid>
					<Row>
						<Col sm={6}>
							{new Date().getFullYear()} © Universidad Católica Andrés Bello.
						</Col>
						<Col sm={6}>
							<div className="text-sm-right d-none d-sm-block">
								Tesis hecha por: <i className="mdi mdi-heart text-danger"></i>{" "}
								Alexander D. y Vladimir B.
							</div>
						</Col>
					</Row>
				</Container>
			</footer>
		</React.Fragment>
	);
};

export default Footer;
